function Navbar() {
  return (
    <nav style={{
      padding: '10px 20px',
      backgroundColor: '#2196f3',      // Warna navbar biru terang
      display: 'flex',
      alignItems: 'center',
      gap: '20px',
      boxShadow: '0 2px 5px rgba(33, 150, 243, 0.3)'
    }}>
      {/* Logo diganti dari tulisan jadi gambar */}
      <Link to="/" style={{ display: 'flex', alignItems: 'center', textDecoration: 'none' }}>
        <img 
          src="/logo.png" 
          alt="Logo KARSO" 
          style={{ height: '40px' }}  // Atur ukuran logo sesuai kebutuhan
        />
      </Link>

      {/* Tombol Tren Pencarian */}
      <Link 
        to="/trending"
        className="btn-custom"
        style={{
          marginLeft: 'auto',
          padding: '8px 25px',
          borderRadius: '30px',
          backgroundColor: '#1976d2',
          color: 'white',
          fontWeight: '600',
          textDecoration: 'none',
          transition: 'background-color 0.3s ease',
        }}
        onMouseEnter={e => e.target.style.backgroundColor = '#1565c0'}
        onMouseLeave={e => e.target.style.backgroundColor = '#1976d2'}
      >
        Tren Pencarian
      </Link>
    </nav>
  );
}
